(1440, 'Bukan Hijrah Biasa', 772, 2, 5, 9, 'Ketika cinta bertasbih, rautan wajah menghasilkan sinar, hati bahagia tanpa spasi, dan hidup damai tanpa beban. Meski banyak ujian yang menghampiri, pemilik cinta akan melewatinya dengan sabar dan ia menganggap bahwa semua yang menyesakkan pasti berlalu. Kita pernah berada pada kungkungan cinta yang menggelisahkan. Berharap mengenal si doi lalu membuat kita selalu tersenyum dan tertawa. Tapi nyatanya, kehadiran dia adalah sebaliknya. Hanya luka yang ia bawa, hanya perih yang ia titipkan. Kita bingung, jalan mana yang harus kita pilih? Cara apa yang bisa kita lakukan untuk mengembalikan kebahagiaan yang telah hilang?\r\nBuku ini membahas tentang cinta yang mengarah kepada Allah dengan jalan taat, bukan dengan jalan maksiat. Memberi gambaran tentang cinta sebenarnya lewat jalan Tuhan, bukan pacaran berakhir penyesalan. Semoga buku ini menjernihkan hati dan pikiran, serta membantu menunjukan move on sejati dalam memperoleh cinta yang menggelorakan. Mendekatkan kita pada Ilahi, bukan pada birahi. Karena di jalan Ilahi, cinta sesungguhnya kita miliki.', 21, 21, '20180403041435.jpg', '2018-03-20 20:50:16', '2018-04-02 21:14:35'),
