(2129, 'Teori Bilangan', 306, 6, 7, 9, 'Teori bilangan merupakan mata kuliah wajib pada program studi Pendidikan Matematika atau Matematika. Mata kuliah ini tidak memerlukan mata kuliah prasyarat. Dasar yang digunakan untuk mengikuti mata kuliah Teori Bilangan adalah materi yang telah diperoleh pada jenjang pendidikan SMA/SMK/STM.\r\nPada bab pertama, buku ini dibahas mengenai sistem bilangan dari sistem bilangan cacah hingga sistem bilangan bulat. Pada bab berikutnya, membahas tentang keterbagian, FPB, KPK, dan bilangan prima, faktorisasi tunggal. Bab selanjutnya, menguraikan mengenai kekongruenan dan kekongruenan linear. Penulis menambahkan bab mengenai sistem bilangan asli. Seluruh bab di dalam buku ini disusun berdasarkan kemampuan akhir mahasiswa yang ingin diperoleh untuk melengkapi kompetensinya sebagai lulusan Pendidikan Matematika dan lulusan Matematika.', 24, 23, '20180403040756.jpg', '2018-03-20 20:50:44', '2018-04-02 21:07:56'),
