(3115, 'Matematika 2B SMA/MA Kelas XI Semester 2 Kurikulum 2013 Kelompok Wajib', 358, 125, 1, 9, 'Apa isi buku ini?\r\n1. Awal bab selalu dimulai dengan ilustrasi kehidupan nyata dan Imabel (Inspirasi Materi Pembelajaran) pada tiap bab.\r\n2. Setiap bab akan dipaparkan dengan peta konsep dan kata kunci agar memudahkan guru dalam menjelaskan isi materi.\r\n3. Isi dari bab dan subbab selalu menyajikan konsep-konsep dasar matematis yang diuraikan dan dijelaskan secara sistematis, jelas, dan padat melalui metode pendekatan induktif maupun deduktif. Selain itu, isi buku disertai juga contoh soal yang sudah dilabeli tujuan pembelajaran untuk mencapai penguasaan keempat kompetensi, yaitu: kompetensi sikap spiritual, kompetensi sikap sosial, kompetensi pengetahuan, kompetensi keterampilan.\r\n4. Latihan dalam buku ini diberi nama LKS (Latihan Kompetensi Siswa) yang disusun dalam tiga tingkatan daya serap siswa, yaitu evaluasi pengertian atau ingatan dalam bentuk PG (Pilihan Ganda), evaluasi pemahaman dan penguasaan materi dalam bentuk uraian, dan evaluasi kemampuan analisis dalam bentuk uraian berstruktur sebagai tolok ukur penilaian terhadap siswa. Selain itu, dilengkapi juga dengan Bekel (Belajar Kelompok) sebagai pembentukan karakter siswa.\r\n5. Pada setiap akhir bab diberikan Rangkuman Materi dan dilengkapi dengan Ruko (Review Uji Kompetensi Siswa). Setelah Ruko, disediakan Quiz Bab yang diberi batasan waktu, sebagai alat ukur pemahaman siswa dalam bentuk soal terhadap materi yang telah dipelajari sehingga diperoleh kualitas pembelajaran di kelas.', 20, 20, '20180403035739.jpg', '2018-03-20 20:51:23', '2018-04-02 20:57:39'),
