(5481, 'Membuka Pintu Harapan', 524, 23, 3, 6, 'Harapan! Ia adalah energi dahsyat yang mampu mengubah ketakutan menjadi kekuatan. Ia yang bisa meyakinkan diri bahwa selepas gelap selalu ada cahaya. Sesudah kesusahan ada kemudahan. Buku berjudul Membuka Pintu Harapan ini adalah buku yang menyingkap kedahsayatan sebuah harapan. Buku yang dikemas dengan bentuk self motivation dan disertai kisah nyata ini terbagi menjadi beberapa pintu. Pintu Gerbang yang mengurai mendalam perihal kekuatan harapan (the power of hope).\r\nBuku ini ditutup dengan Pintu 8: Kisah tentang Harapan di mana penulis mengurai ulang berbagai kisah klasik tentang harapan. Diulas dengan bahasa yang sederhana, kisah nyata dalam buku ini semoga bisa memberikan makna baru tentang hidup dan kehidupan. Keseluruhan buku ini, mengajak diri untuk menjadi pribadi nan optimis. Mengeluarkan segenap talenta demi meraih kesuksesan hidup. Seberapa kelam pun masa lalu, selalu ada harapan, theres always hope. Mari kita buka pintu harapan itu. Selamat membaca!', 26, 26, '20180403041146.png', '2018-03-20 20:53:04', '2018-04-02 21:11:46'),
