(7822, 'Salma Schimmel', 281, 22, 31, 8, NULL, 22, 15, NULL, '2018-03-20 20:54:45', '2018-03-20 20:54:45'),
(7823, 'Jangan Cemas, Berzikirlah!', 801, 243, 8, 6, 'Kecemasan, ketakutan, dan kekhawatiran merupakan respons emosi yang dimiliki manusia karena perasaan tidak menentu dan tidak berdaya. Respons emosi itu menyerang dan merapuhkan bagian dalam diri manusia. Jika bagian dalamnya sudah rapuh, maka bagian luar pun dengan mudah akan rapuh. Kita harus mengendalikan rasa-rasa itu agar tidak muncul secara berlebihan. Jangan sampai respons cemas, khawatir, takut, dan hal-hal lain semacamnya muncul berlebih dan mengambil alih diri kita.\r\nSebab hal itu sangat berbahaya bagi jiwa dan fisik seseorang yang mengalaminya. Bagaimana caranya? Cara agar kita terbebas dari rasa ketakutan, kekhawatiran, dan kecemasan yang bisa datang kapan saja tanpa mengenal senggang waktu? Tidak lain dan tidak bukan adalah dengan mendekatkan diri dan mengingat Allah. Secara sederhana, zikir adalah mengingat Allah.\r\nKita diperintahkan agar senantiasa berzikir kepada Allah. Allah Swt., berfirman, Hai orang-orang yang beriman, berzikirlah (dengan menyebut nama) Allah, zikir yang sebanyak-banyaknya (QS. Al-Ahzab: 41).\r\nDi dalam surah yang lain Allah Swt., berfirman, (Yaitu) orang-orang yang mengingat Allah sambil berdiri atau duduk atau dalam keadan berbaring dan mereka memikirkan tentang penciptaan langit dan bumi (seraya berkata): Ya Tuhan kami, tiadalah Engkau menciptakan ini dengan sia-sia, Mahasuci Engkau, maka peliharalah kami dari siksa neraka (QS. Ali Imran: 191).\r\nBuku ini hadir untuk memberikan jawaban bagaimana mengusir ketakutan, kekhawatiran, dan kecemasan kita. Buku ini mencoba mengajak kita ber-taqarrub kepada Allah. Semoga kita bisa semakin mendekat kepada-Nya, semakin cinta kepada-Nya, hingga akhirnya kita merenggut manisnya cinta bersama-Nya. Dengan apa? Tentunya dengan zikir kepada-Nya. Selamat membaca!', 25, 25, '20180403034328.jpg', '2018-03-20 20:54:45', '2018-04-02 20:43:29'),
