(26351, 'Aku Berusaha  Allah yang Punya Kuasa', 802, 243, 1, 6, 'Buku ini mengajakmu untuk merenung dan menyadari bahwa jika kamu berusaha, dan kemudian berhasil, ada Allah dibalik keberhasilan itu. Sehingga kamu tidak lupa diri dan menyangka keberhasilan yang kamu raih adalah hasil usaha dan kerja keras semata, melainkan karena pertolongan Allah. Di sisi lain ketika usaha telah maksimal kamu lakukan, tapi hasilnya tidak sesuai dengan harapan tak lantas membuat kamu terpuruk dan putus asa. Allah punya rencana yang lebih indah dan terbaik untuk hamba-hamba-Nya. Allah maha adil, pengasih dan penyayang, sehingga tidak mungkin menjadikan hamba-Nya sengsara. Sebaliknya Allah ingin hamba-Nya sehat, sejahtera dan bahagia. Berusahalah dan biarlah Allah yang menentukan hasil akhirnya.\r\nTerimalah dengan ridha pemberian Allah, maka Allah ridha dengan dirimu. Jika Allah ridha, maka beruntunglah dirimu di dunia dan di akhirat kelak. Selling point; Disertai kisah2 hikmah Kata kunci; agama, islam, adab, inspirasi', 23, 23, '20180502174607.jpg', '2018-04-08 08:37:46', '2018-05-02 10:46:07'),
