(27029, 'Prof. Rosalind Nikolaus Sr.', 630, 64, 7, 11, NULL, 21, 14, NULL, '2018-04-08 08:38:16', '2018-04-08 08:38:16'),
(27030, 'SPM Teknik Komputer & Jaringan SMK/MAK', 3, 243, 1, 10, 'Buku yang ditujukan untuk peserta didik SMK/MAK Bidang Studi Keahlian Teknik Komputer dan Jaringan ini termasuk seri buku soal yang disusun sebagai persiapan peserta didik dalam menghadapi Ujian Nasional.Buku ini terbagi dalam tiga unit.\r\nUnit 1, berisi rangkuman, contoh soal dan pembahasan, serta soal-soal latihan untuk tiap pokok bahasan dari kelas X sampai kelas XII. Penyajian pada unit ini diberikan untuk mengingat kembali materi yang akan diujikan. Penyajian dilengkapi contoh soal dan pembahasan yang efektif, berikut latihan soal-soal tipe Ujian Nasional.\r\nUnit 2, berisi paket latihan soal mandiri menghadapi Ujian Nasional. Penyajian pada unit ini diberikan sebagai latihan (geladi bersih) agar peserta didik siap dalam menghadapi Ujian Nasional yang sesungguhnya.\r\nUnit 3, berisi contoh soal dan pembahasan Ujian Nasional PraktikTeknik Komputer dan Jaringan. Penyajian pada unit ini diberikan sebagai sarana berlatih mandiri dalam menghadapi Ujian Nasional PraktikTeknik Komputer dan Jaringan.', 12, 12, '20180502180111.jpg', '2018-05-02 11:01:11', '2018-05-02 11:01:11'),
